import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import logo from './logo.png'; // Place your "logo.png" in /src/components

const Nav = styled.nav`
  background-color: #002B5C; /* A Greyhound-like deep navy */
  color: #fff;
  padding: 1rem 2rem;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const LogoSection = styled.div`
  display: flex;
  align-items: center;

  img {
    height: 40px;
    margin-right: 0.5rem;
  }

  span {
    font-size: 1.2rem;
    font-weight: bold;
  }
`;

const NavLinks = styled.div`
  a {
    margin-left: 1.5rem;
    font-weight: 500;
    color: #fff;
    &:hover {
      text-decoration: underline;
    }
  }
`;

function Navbar() {
  return (
    <Nav>
      <LogoSection>
        <img src={logo} alt="Logo" />
        <span>Centro</span>
      </LogoSection>
      <NavLinks>
        <Link to="/">Home</Link>
        <Link to="/tracker">Tracker</Link>
        <Link to="/schedule">Schedule</Link>
      </NavLinks>
    </Nav>
  );
}

export default Navbar;
